public class Solution {
    public List<String> findRepeatedDnaSequences(String s) {
    	Set<String> ans = new LinkedHashSet<String>();
    	List<Integer> Alist = new ArrayList<Integer>();
    	List<Integer> Clist = new ArrayList<Integer>();
    	List<Integer> Glist = new ArrayList<Integer>();
    	List<Integer> Tlist = new ArrayList<Integer>();
        for(int i=0;i<s.length();i++){//init list
        	char c = s.charAt(i);
        	if(c=='A') Alist.add(i);
        	else if(c=='C') Clist.add(i);
        	else if(c=='G') Glist.add(i);
        	else if(c=='T') Tlist.add(i);
        }
    	for(int i=0;i<=s.length()-10;i++){
    		String t = s.substring(i,i+10);
    		if(ans.contains(t)) continue;
    		char start = t.charAt(0);
    		List<Integer> cand;
    		switch(start){
    			case 'A':cand = Alist;break;
    			case 'C':cand = Clist;break;
    			case 'G':cand = Glist;break;
    			default:cand = Tlist;break;
    		}
    		int nextindex = Collections.binarySearch(cand,i)+1;
    		for(int j=nextindex;j<cand.size();j++){
    			int sindex = cand.get(j);
    			if(sContainsSub(s,sindex,t)){
    				ans.add(t);
    				break;
    			}
    		}
    	}
    	return new LinkedList<String>(ans);

    }
    public boolean sContainsSub(String s,int index,String sub){
    	if(index+sub.length()>s.length()) return false;
    	boolean ans = true;
    	for(int i=0;i<sub.length();i++){
    		if(s.charAt(index+i)!=sub.charAt(i)){
    			ans = false;
    			break;
    		}
    	}
    	return ans;
    }
}

